import React from 'react';
import './App.css';
import Widget_Chart from './Widgets/Chart'

// Page Widgets 
function Page_Principale() {
    return(

        <div className="widget-Chart">
            <Widget_Chart></Widget_Chart> 
        </div>
        
    );
}

export default Page_Principale;
